 <p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Negreta&quot;,&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:700'>客服中心新增用户信息模块</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>路径：ERP - 客服模块 - 用户信息 </span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>① 支持Userid、手机、邮箱、订单号，deviceid批量查询；多个用回车换行；单次最多查询100条</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>② 支持批量导出，按照查询结果全部导出</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>③ 若deviceid未注册，则所有字段 展示 “-”，操作无&quot;详情&quot;</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>④ 未查询/查询无结果时，仅出表头</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span></p>

 <div id=u286_text class=text>
 <p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Negreta&quot;,&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:700'>详情面板</span><p><span style='font-family:&quot;Arial Negreta&quot;,&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:700'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>① 由基本信息和分类信息组成</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>② 分类信息支持tab切换</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>③ 样式为普通页面（新开tab）</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span></p>

 <p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Negreta&quot;,&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:700'>分类信息 - 资产明细</span><p><span style='font-family:&quot;Arial Negreta&quot;,&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:700'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>① 汇总用户当前积分，余额：拆分可用和不可用，展示样式同列表</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>② 支持按照下列字段查询</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>资产类型：积分/余额（不可提现）/余额（可提现），默认全部</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>发生方式：增加/减少，默认全部</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>发生时间：支持年月日是否，默认近30天</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>③ 支持重置条件，重置则都恢复默认值并查询</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>④ 支持翻页，每页100</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>⑤ 表单按照 资产类型/发生方式/备注/发生时间展示</span></p>

 <div id=u288_text class=text>
 <p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Negreta&quot;,&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:700'>分类信息 - 优惠券</span><p><span style='font-family:&quot;Arial Negreta&quot;,&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:700'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>① 支持按照下列字段查询</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>状态：待使用、已失效，已使用；默认全部</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>发放时间：支持年月日是否，默认近30天</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>失效时间：支持年月日是否，默认不限</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>使用时间：支持年月日是否，默认不限</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>② 支持重置条件，重置则都恢复默认值并查询</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>③ 表单见左</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>④ 优惠券状态为已使用，则展示优惠券code和订单号，订单号支持点击跳转至订单详情，返回时不刷新当前页面</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>⑤ 明细展示 用户所在国家门槛（起止，若为梯度则按照梯度多条展示）和力度（不展示货币）</span><p><span st  <div id=u289_text class=text>
 <p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Negreta&quot;,&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:700'>分类信息 - 订单信息</span><p><span style='font-family:&quot;Arial Negreta&quot;,&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:700'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>① 数据汇总+订单管理拼接展示（移除部分订单修改操作）</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>② 此处订单管理，仅展示该Userid的所有订单（不支持手动筛选Userid）</span><p><span style='font-family:&quot;Arial Negreta&quot;,&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:700'>* ERP订单管理增加按照Userid查询</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>③ 数据汇总 （数据为过去365天滚动计算）</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>- 累计付款：按照付款数量和付款金额（转USD）展示，有付款时间即可</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>- 平均笔单：付款总额/付款总订单数</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>- 在线支付占比：按照非COD付款订单数和非COD订单数占比展示，</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>占比 = 非COD订单数/总付款订单数</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>- 在线支付拒付展示：按照拒付订单数和拒付订单数占比展示，</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>占比 = 拒付订单数/在线支付订单数 (当前无数据，展示为 “-”)</span><p><span style='font-family:&quot;Arial Negreta&quot;,&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:700'>*数据来源：ERP订单详情&amp;nbsp; - 备注 - 人工备注为拒付</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>- 签收情况：按照签收订单数和签收率展示，签收率= 签收订单数/发货订单数</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>- 售后单：按照发货后退货退款单的条数（退款成功）数量和退货率展示，</span><span style='font-family:&quot;Arial Negreta&quot;,&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:700'>退货率= 退款</span><span style='font-family:&quot;Arial Negreta&quot;,&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:700;text-decoration:underline'>商品数</span><span style='font-family:&quot;Arial Negreta&quot;,&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:700'>/签收</span><span style='font-family:&quot;Arial Negreta&quot;,&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:700;text-decoration:underline'>商品数</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>- 退货退款：按照发货后退货退款单数（退款成功）和退货退款占比展示，退货退款占比=退货退款单数（退款成功）/售后单（退款成功）</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>- 仅退款：按照发货后仅退款单数（退款成功）和仅退款占比展示，仅退款占比=仅退款单数（退款成功）/售后单（退款成功）</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>*所有率值按照百分比后两位展示</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>④ 该页签右上角增加 字段计算规则展示，展示内容为 ③</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span></p>

 <p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Negreta&quot;,&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:700'>分类信息 - 地址信息</span><p><span style='font-family:&quot;Arial Negreta&quot;,&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:700'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>① 展示用户地址簿所有地址</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>② 默认地址标记为默认地址，置顶展示</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>③ 地址按照 地址N展示，N从1开始</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>④ 地址展示形式同订单详情，地址信息模块，支持复制复制，不支持编辑，此处不支持超链跳转</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span></p>

 <div id=u312_text class=text>
 <p style=font-size:50px><span style='font-family:&quot;Arial Negreta&quot;,&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:700'>订单详情支持调整用户详情</span><p style=font-size:35px><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>路径：ERP - 订单管理 - 订单详情 </span><p style=font-size:35px><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p style=font-size:35px><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>① 用户信息模块：联系电话、联系电话2、邮箱，Userid都支持超链到指定字段查询后的用户详情页面</span><p style=font-size:35px><span style='font-family:&quot;Arial Negreta&quot;,&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:700'>如果一对多userid，则取最新一条记录的userid进行查询</span><p style=font-size:35px><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p style=font-size:35px><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>② 若查询不到信息，则点击后toast提示“未查询到用户信息”</span></p>

 <div id=u321_text class=text>
 <p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>- 累计付款：按照付款数量和付款金额（转USD）展示，有付款时间即可</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>- 平均笔单：付款总额/付款总订单数</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>- 在线支付占比：按照非COD付款订单数和非COD订单数占比展示，</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>占比 = 非COD订单数/总付款订单数</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>- 在线支付拒付展示：按照拒付订单数和拒付订单数占比展示，</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>占比 = 拒付订单数/在线支付订单数 (当前无数据，展示为 “-”)</span><p><span style='font-family:&quot;Arial Negreta&quot;,&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:700'>*数据来源：ERP订单详情&amp;nbsp; - 备注 - 人工备注为拒付</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>- 签收情况：按照签收订单数和签收率展示，签收率= 签收订单数/发货订单数</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>- 售后单：按照发货后退货退款单的条数（退款成功）数量和退货率展示，退货率= 退款</span><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400;text-decoration:underline'>商品数</span><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>/签收</span><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400;text-decoration:underline'>商品数</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>- 退货退款：按照发货后退货退款单数（退款成功）和退货退款占比展示，退货退款占比=退货退款单数（退款成功）/售后单（退款成功）</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>- 仅退款：按照发货后仅退款单数（退款成功）和仅退款占比展示，仅退款占比=仅退款单数（退款成功）/售后单（退款成功）</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>*所有率值按照百分比后两位展示</span><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span><p><span style='font-family:&quot;Arial Negreta&quot;,&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:700'>数据为过去365天滚动计算</span></p>
